import styled from 'styled-components';

export const Container = styled.div`
  background:var(--color-white);

  border-bottom:var(--color-border-top);




  >ul li{
    display:flex;
    justify-content:center;
    align-items:center;
    padding:2px;
    width: 20px;
    margin-right: 8px;

    >span{
      padding-left:5px;
      display:flex;
      justify-content:center;
      align-items:center;


    }

    }

`;


export const IconImage  = styled.img`
    height:154px;
    width:54px;
    display:flex;
    justify-content:center;
    align-items:center;
    text-align: left;

`;
